const generateLastStepsHTML = (data, needsPageBreak = false) => {
  const content = `
    <div class="step-content avoid-break-border">      
      ${generateStep3HTML(data.step3)}
      ${generateStep4HTML(data.step4)}
      ${generateStep5HTML(data.step5)}
      ${generateStep6HTML(data.step6)}
      ${generateStep7HTML(data.step7)}
      ${generateStep8HTML(data.step8)}
      ${generateStep9HTML(data.step9)}
      ${generateStep10HTML(data.step10)}            
    </div>
  `;

  return generatePageTemplate(
    content,
    "Part A â€“ Insured Details",
    needsPageBreak
  );
};

export const techConsultFormTemplate = (formData) => {
  const steps = Object.keys(formData).filter((stepKey) => {
    if (stepKey === "step2") return true;
    return formData[stepKey] && Object.keys(formData[stepKey]).length > 0;
  });

  const content = steps
    .map((stepKey) => {
      switch (stepKey) {
        case "step1":
          return generateStep1HTML(formData[stepKey], false, false);
        case "step2":
          return generateStep2HTML(formData[stepKey], true, false);
        case "step3":
          return generateLastStepsHTML(formData, true, true);
        default:
          return "";
      }
    })
    .join("");

  return generateTailwindHTML(content);
};
